import React, {Component} from 'react';
import Card from './Card';

class CardList extends Component{
	render(){
		const{list} = this.props;
		return(
			<div>
				{
					list.map((index, item) =>{
						return <Card key = {list.id} name = {list.name} img = {list.image}/>;
					})
				}
			</div>
			);
	}
}

export default CardList;
